export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},DdIV7PtLIi:{data:{id:1050,attributes:{imdbId:"tt3183660",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjMxOTM1OTI4MV5BMl5BanBnXkFtZTgwODE5OTYxMDI@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.3\u002F10"},{Source:"Rotten Tomatoes",Value:"74%"},{Source:"Metacritic",Value:"66\u002F100"}],item_lang:{data:{id:1713,attributes:{title:d,plot:"In mid-1920s New York, Newt Scamander, a British young activist wizard, arrives in the city, holding a mysterious leather suitcase that shelters diverse and magical creatures that exist among us. Amid an already fragile equilibrium of secrecy, and the increasing disasters ascribed to the dark wizard, Gellert Grindelwald, Newt's precious suitcase goes missing, and to make matters worse, several creatures manage to escape. Before long, this unforeseen complication catches Senior Auror Percival Graves' attention who targets Newt, against the backdrop of an invisible, devastating, and utterly unpredictable menace that still wreaks havoc on 5th Avenue. In the end, is there a hidden agenda behind Graves' intentions? Moreover, what will happen to the remaining fantastic beasts that are still on the loose?",slug:"fantastic-beasts-and-where-to-find-them"}}},books:{data:[{id:6066,attributes:{title:"Fantastic Beasts & where to Find Them",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rOIz1td9zrYC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:true,published:"1000-01-01",publisher:"A&C Black",subtitle:a}},{id:6067,attributes:{title:"Fantastic Beasts and Where to Find Them: The Original Screenplay",description:"When Magizoologist Newt Scamander arrives in New York, he intends his stay to be just a brief stopover. However, when his magical case is misplaced and some of Newt's fantastic beasts escape, it spells trouble for everyone... Inspired by the original Hogwart’s textbook by Newt Scamander, Fantastic Beasts and Where to Find Them: The Original screenplay marks the screenwriting debut of J.K. Rowling, author of the beloved and internationally bestselling Harry Potter books. A feat of imagination and featuring a cast of remarkable characters and magical creatures, this is epic adventure-packed storytelling at its very best. Whether an existing fan or new to the wizarding world, this is a perfect addition for any film lover or reader’s bookshelf. The film Fantastic Beasts and Where to Find Them will have its theatrical release on 18th November 2016.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DU0LDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["J.K. Rowling"],firstBook:c,published:"2016-11-18",publisher:"Pottermore Publishing",subtitle:a}},{id:6068,attributes:{title:d,description:"This glorious paperback edition of Newt Scamander'sFantastic Beasts and Where to Find Themis considered a classic throughout the wizarding world. It features an extraordinary array of magical creatures, from Acromantula to Yeti via ten different breeds of dragon - all beautifully illustrated in full colour by the brilliantly inventive, Greenaway Medal shortlisted Olivia Lomenech Gill. Famed Magizoologist Newt Scamander's years of adventure and exploration have yielded a work of unparalleled importance, admired by scholars, devoured by young witches and wizards, and even made available to Muggles in the early years of this century. With this dazzling illustrated edition, readers can explore the magical fauna of five continents from the comfort of their own armchairs.Fantastic Beasts and Where to Find Themis essential reading at Hogwarts. Now available in a stunning paperback edition with French flaps, this edition contains all of the mesmerising illustrations from the original edition and features the fully updated 2017 text including a foreword by J.K. Rowling, writing as Newt Scamander.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=s77iyQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e],firstBook:c,published:"2020-02-06",publisher:"Bloomsbury Harry Potter",subtitle:a}},{id:6069,attributes:{title:"Fantastic Beasts and Where to Find Them: The Illustrated Edition",description:"An essential companion to the Harry Potter novels, now fully illustrated! Fantastic Beasts and Where to Find Them, Newt Scamander's classic compendium of magical creatures, has delighted generations of wizarding readers. With this beautiful, large-scale new edition illustrated in full color, Muggles too will have the chance to discover where the Runespoor lives, what the Puffskein eats, and why shiny objects should always be kept away from the Niffler. Proceeds from the sale of this book will go to Comic Relief and J.K. Rowling's international charity, Lumos, which will do magic beyond the powers of any wizard. If you feel that this is insufficient reason to part with your money, one can only hope that passing wizards feel more charitable if they see you being attacked by a Manticore.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OkW7AQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e,h],firstBook:c,published:"2017-11-07",publisher:i,subtitle:a}},{id:6070,attributes:{title:d,description:"Written by J.K. Rowling as a fictitious author.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=TpImrgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[h],firstBook:c,published:"2015-06-30",publisher:i,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309488496}}("","movie",null,"Fantastic Beasts and Where to Find Them","J. K. Rowling","series",1,"Newt Scamander","Arthur A. Levine Books"))